            <tr>
                <td>{{ user.id }}</td>
                <td>{{ user.userType }}</td>
                <td>{{ user.email }}</td>
                <td>{{ user.passwd }}</td>
                <td>{{ user.nickname }}</td>
                <td>{{ user.banned ? 'Yes' : 'No' }}</td>
                <td>
